import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import FraudPage from './pages/FraudPage';
import CounterfeitPage from './pages/CounterfeitPage';
import ReviewSpamPage from './pages/ReviewSpamPage';
import ReturnAnomalyPage from './pages/ReturnAnomalyPage';

const App = () => {
  return (
    <Router>
      <div className="flex min-h-screen bg-gray-100">
        <aside className="w-64 bg-white border-r shadow-md">
          <div className="p-4 text-xl font-bold text-blue-600 border-b">TSCC Console</div>
          <nav className="flex flex-col space-y-2 p-4 text-sm">
            <Link to="/" className="hover:text-blue-600">Fraud</Link>
            <Link to="/counterfeit" className="hover:text-blue-600">Counterfeit</Link>
            <Link to="/review" className="hover:text-blue-600">Review Spam</Link>
            <Link to="/return" className="hover:text-blue-600">Return Anomaly</Link>
          </nav>
        </aside>
        <main className="flex-1 p-6">
          <Routes>
            <Route path="/" element={<FraudPage />} />
            <Route path="/counterfeit" element={<CounterfeitPage />} />
            <Route path="/review" element={<ReviewSpamPage />} />
            <Route path="/return" element={<ReturnAnomalyPage />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
};

export default App;
